import { Header } from "./components/Header";
import "./App.css";
import axios from "axios";

function App() {
  let componentDidMount = () => {
    // Simple GET request using axios
    axios
      .get("https://movie-task.vercel.app/api/popular?page=1")
      .then(
        (datas) => console.log(datas.data.data.results[1]));
  };

  return (

    <div className="App">
      <Header/>
      <header onClick={componentDidMount} className="App-header">
        Learn React
      </header>
    </div>
  );
}

export default App;
